var fractalized_src = "from earsketch import *\n\n# functions\n\ndef expandRhythm(rhythmicPattern, collection):\n# input the rhythmic points of the \"current level\", and also the collection of all the previously collected rhythmic points\n    expanded = []\n    for place in rhythmicPattern:\n        for element in collection:\n            expanded.append(place + element)\n    return expanded\n# outputs a more expanded collection of rhythmic points, expanded for the current level of recursion\n\n# parameters for recursiveRhythm() below:\n#   currentLevelRhythm -- the basic rhythmic points (preferably in sub-beats as floats)\n#   collectedRhythmSoFar -- a list containing just \"0\" to start collecting the rhythmic points\n#   depth -- the depth of recursion\n\ndef recursiveRhythm(currentLevelRhythm, collectedRhythmSoFar, depth):\n    # create empty list to hold new values\n    higherLevelRhythm = []\n    # check stopping condition\n    if depth < 1:\n    # once it has recursed to the provided depth, return the list of all rhythmic points collected over the recursion process\n        return collectedRhythmSoFar\n    # else if it's still recursing, multiply the rhythmic points of the current level by 4, to make the points for the next higher level\n    for hit in currentLevelRhythm:\n        higherLevelRhythm = higherLevelRhythm + [ hit*4 ]\n    # expand the collection of points further, by adding the current collection to each point in the current level rhythm\n    expandedCollection = expandRhythm(currentLevelRhythm, collectedRhythmSoFar)\n    # also pass in the collection of rhythmic points so far, to keep the collection growing.. also pass in the new depth (the previous depth minus 1)\n    # recursively call the same function, supplying it the new higher level rhythmic points\n    # (to become the \"current level\" rhythmic points for the next round of recursion)\n    return recursiveRhythm(higherLevelRhythm, expandedCollection, depth-1)\n\n# sounds and data used in the piece\n\ndrumloop = DUBSTEP_DRUMLOOP_MAIN_007\npercsound = TECHNO_LOOP_PART_013\nsynthsound = ELECTRO_ANALOGUE_LEAD_001\n\n# the length of the returned list of rhythmic points will be the length of the first list to the power of the supplied depth...\n# (here it will be 3^4 = 81 rhythmic points)\nrhythmicPoints1 = recursiveRhythm([0, 0.0625, 0.1875], [0], 4)\nrhythmicPoints2 = recursiveRhythm([0, 0.125, 0.1875], [0], 4)\n\n# code to generate piece\n\ninit()\nsetTempo(140)\n\nfitMedia(drumloop, 1, 1, 17) # place a steady drum loop on track 1 for the whole 16 bars\n\nfor timepoint in rhythmicPoints1:\n    # for each timepoint, place the percsound clip on track 2 at the location of the timepoint, for the length of 1/16-note\n    fitMedia(percsound, 2, timepoint+1, timepoint+1.0625)\nfor timepoint in rhythmicPoints2:\n    # for each timepoint, place the synth sound clip on track 3 at the location of the timepoint, for the length of 1/16-note\n    fitMedia(synthsound, 3, timepoint+1, timepoint+1.0625)\n\nfinish()";

